export const Footer = () => {
  return (
    <section>
      <div className="bg-footerBg bg-no-repeat bg-cover w-full m-0">
        <img
          className="lg:flex m-0 lg:w-auto object-cover "
          src="/treaty-png-1.svg"
          alt=""
        />
      </div>
    </section>
  );
};
